import "./Card.scss";

interface CardInfo {
	id: string;
	boardId: string;
	columnId: string;
	title: string;
	image: string | null;
}

const Card = (props: { card: CardInfo }) => {
	return (
		<>
			<li className='card-item'>
				<img src='https://picsum.photos/256/128' alt='alt text' />
				Design & Research
			</li>
		</>
	);
};

export default Card;
